import React from "react";
import Options from "./Options";
import { PageHeader } from "antd";

export default (props: {
  setType: Function;
  setName: Function;
  name: String;
  type: String;
}) => {
  const { setType, setName } = props;
  return (
    <PageHeader
      title="My Pokedex"
      ghost={false}
      extra={
        <Options
          setType={(type: string) => setType(type)}
          setName={(name: string) => setName(name)}
          name={props.name}
          type={props.name}></Options>
      }></PageHeader>
  );
};
